        function filterDropdown() {
            const input = document.getElementById('searchRazonSocial');
            const filter = input.value.toLowerCase();
            const select = document.getElementById('razonSocial');
            const options = select.getElementsByTagName('option');
            for (let i = 0; i < options.length; i++) {
                const txtValue = options[i].textContent || options[i].innerText;
                if (txtValue.toLowerCase().indexOf(filter) > -1) {
                    options[i].style.display = "";
                } else {
                    options[i].style.display = "none";
                }
            }
        }

        function filterBP() {
            const selectedRazonSocial = document.getElementById('razonSocial').value;
            const container = document.getElementById('bpContainer');
            container.innerHTML = '';
            data.forEach(row => {
                if (row['RAZÓN SOCIAL'] === selectedRazonSocial) {
                    const div = document.createElement('div');
                    div.innerHTML = `<input type="checkbox" value="${row['BP SUCURSAL']}"> ${row['BP SUCURSAL']}`;
                    container.appendChild(div);
                }
            });
        }

        function generateList() {
            const checkboxes = document.querySelectorAll('#bpContainer input[type="checkbox"]:checked');
            const selectedList = document.getElementById('selectedList');
            selectedList.innerHTML = '';
            checkboxes.forEach(checkbox => {
                selectedList.innerHTML += checkbox.value + '\n';
            });
        }

        function copyToClipboard() {
            const selectedList = document.getElementById('selectedList');
            const text = selectedList.innerText;
            navigator.clipboard.writeText(text).then(() => {
                alert('Copied to clipboard');
            });
        }
    </script>
